const sourceCode = "import Image from 'next/image';\n\n# Unlocking Pro Features in the Figma\n\nIf you are a Boxicons Pro user, you can unlock the full icon library inside the Figma plugin.\n\nTo get started, click the **Pro User** button in the top-right corner of the plugin. This will open a modal asking for your API token.\n<br/>\n---\n\n## Get Your API Token\n\nYou can find your API token in your Boxicons account dashboard:\n\nðŸ‘‰ https://boxicons.com/account/settings\n\nYour API token will always start with: `bx_`\n\n\n## Activate Pro Access\n<div className=\"flex gap-5 space-between flex-col md:flex-row\">\n<div className=\"basis-1/2 py-5\" >\n\n1. Click the **Pro User** button in the plugin.\n2. Paste your API token into the input field.\n3. Click **Verify**.\n\nOnce the token is validated, the plugin will unlock **all Pro icons**, giving you access to:\n\n- 50,000+ icon variations\n- All packs, styles, and weights\n- All duotone variantsyles\n\n</div>\n<div className=\"basis-1/2 py-5  rounded-2xl  shadow-3xl\" >\n<Image className=\"rounded-2xl figma-side\" src=\"/api.gif\" alt=\"Figma Plugin API\" width={996} height={1080} />\n</div>\n</div>\n\n## Notes\n\n- Your token is validated securely.\n- You only need to enter it once per device/session.\n- If your token expires or is revoked, you can re-enter a new one at any time if you have an active Pro subscription.";
