const sourceCode = "import { Callout } from 'nextra/components'\n\n# Rotation & Flipping\n\nBoxicons provides utility classes to easily rotate or flip icons without writing any custom CSS. These transformations are applied using CSS and work consistently across all icon types.\n<br/>\n---\n<Callout type=\"warning\">\n Make sure you have included the transformations stylesheet before using these classes.\n</Callout>\n\n```html filename=\"transformations.min.css\" copy\n<link href=\"https://cdn.boxicons.com/{{VERSION}}/fonts/transformations.min.css\" rel=\"stylesheet\">\n```\n\n### Rotating Icons\n\nYou can rotate an icon by applying one of the following classes:\n* `bx-rotate-90` â€” rotates the icon by 90Â°\n\n* `bx-rotate-180` â€” rotates the icon by 180Â°\n\n* `bx-rotate-270` â€” rotates the icon by 270Â°\n\n```html copy\n<i class=\"bxf bx-wink-smile bx-rotate-90\"></i>\n<i class=\"bxf bx-wink-smile bx-rotate-180\"></i>\n<i class=\"bxf bx-wink-smile bx-rotate-270\"></i>\n```\n<div className=\"icon-display\">\n<i className=\"bxdocs bxrf-200-wink-smile bx-rotate-90\"></i>\n<i className=\"bxdocs bxrf-200-wink-smile bx-rotate-180\"></i>\n<i className=\"bxdocs bxrf-200-wink-smile bx-rotate-270\"></i>\n</div>\n\n### Flipping Icons\n\nYou can also mirror icons horizontally or vertically using the following classes:\n\n* `bx-flip-horizontal` â€” flips the icon left to right\n\n* `bx-flip-vertical` â€” flips the icon top to bottom\n\n```html copy\n<i class=\"bxf bx-wink-smile bx-flip-horizontal\"></i>\n<i class=\"bxf bx-wink-smile bx-flip-vertical\"></i>\n```\n<div className=\"icon-display\">\n<i className=\"bxdocs bxrf-200-wink-smile bx-flip-horizontal\"></i>\n<i className=\"bxdocs bxrf-200-wink-smile bx-flip-vertical\"></i>\n</div>\n\n### Combining Transformations\n\nYou can combine rotation and flip classes together to achieve more complex transformations.\n\n```html copy\n<i class=\"bxf bx-wink-smile bx-rotate-90 bx-flip-horizontal\"></i>\n```\n<div className=\"icon-display\">\n<i className=\"bxdocs bxrf-200-wink-smile bx-rotate-90 bx-flip-horizontal\"></i>\n\n</div>";
