const sourceCode = "# Animations\n\nBoxicons comes with a set of pre-built CSS animations that let you add motion to your icons with simple utility classes. Animations are useful for drawing attention to actions, indicating loading states, or adding subtle feedback to your UI.\n<br/>\n---\n## Enable Animations\n\nTo use the animation utilities, you first need to include the animations stylesheet in the `<head>` of your page:\n\n```html filename=\"animations.min.css\" copy\n<link href=\"https://cdn.boxicons.com/{{VERSION}}/fonts/animations.min.css\" rel=\"stylesheet\">\n```\n\n## Basic Animations\n\nYou can apply an animation to an icon by adding one of the animation classes directly to it.\n\n### Available animation classes\n\n* `bx-spin`\n* `bx-tada`\n* `bx-flashing`\n* `bx-burst`\n* `bx-fade-left`\n* `bx-fade-right`\n* `bx-fade-up`\n* `bx-fade-down`\n* `bx-breathe`\n* `bx-beat`\n* `bx-wiggle`\n* `bx-bounce`\n\n```html copy\n<i class=\"bxf bx-thumb-up bx-spin\"></i>\n<i class=\"bxf bx-thumb-up bx-tada\"></i>\n<i class=\"bxf bx-thumb-up bx-bounce\"></i>\n```\n<div className=\"icon-display\">\n<i className=\"bxdocs bxrf-200-golf-ball bx-spin\"></i>\n<i className=\"bxdocs bxrf-200-golf-ball bx-tada\"></i>\n<i className=\"bxdocs bxrf-200-golf-ball bx-bounce\"></i>\n</div>\n\nThese animations run continuously by default.\n\n## On Hover Animation\n\nIf you only want the animation to play when the user hovers over the icon, use the -hover variants of the animation classes.\n\n### Hover animation classes\n\n* `bx-spin-hover`\n* `bx-tada-hover`\n* `bx-flashing-hover`\n* `bx-burst-hover`\n* `bx-fade-left-hover`\n* `bx-fade-right-hover`\n* `bx-fade-up-hover`\n* `bx-fade-down-hover`\n* `bx-breathe-hover`\n* `bx-beat-hover`\n* `bx-wiggle-hover`\n* `bx-bounce-hover`\n\n```html copy\n<i class=\"bxf bx-thumb-up bx-spin-hover\"></i>\n<i class=\"bxf bx-thumb-up bx-tada-hover\"></i>\n<i class=\"bxf bx-thumb-up bx-bounce-hover\"></i>\n```\n<div className=\"icon-display\">\n<i className=\"bxdocs bxrf-200-golf-ball bx-spin-hover\"></i>\n<i className=\"bxdocs bxrf-200-golf-ball bx-tada-hover\"></i>\n<i className=\"bxdocs bxrf-200-golf-ball bx-bounce-hover\"></i>\n</div>\n\n\n## Controlling Animation Speed and Repetition\n\nBecause these are pure CSS animations, you can fully control them using standard CSS properties:\n\n* `animation-duration` â€” controls how fast or slow the animation runs\n* `animation-iteration-count` â€” controls how many times the animation repeats\n\n```html copy\n<i\n  class=\"bxf bx-thumb-up bx-spin\"\n  style=\"animation-duration: 2s; animation-iteration-count: 1;\"\n></i>\n```";
