const sourceCode = "import Image from 'next/image';\n\n\n# Usage as a Font\n\nYou can use Boxicons as an icon font to quickly embed icons into your website or application. This is the easiest way to get started and works great for static sites, dashboards, and traditional web projects.\n\nUsing the font version allows you to control icon size, color, and alignment using simple CSS â€” just like text.\n<br/>\n---\n## Import the CSS\n\nTo get started, include the Boxicons stylesheet in the `<head>` of your HTML file. This will load the Boxicons font into your page.\n\n\n### Free icons\n```html copy\n<!-- Basic Icons -->\n<link href=\"https://cdn.boxicons.com/{{VERSION}}/fonts/basic/boxicons.min.css\" rel=\"stylesheet\">\n<!-- Filled Icons -->\n<link href=\"https://cdn.boxicons.com/{{VERSION}}/fonts/filled/boxicons-filled.min.css\" rel=\"stylesheet\">\n<!-- Brand Icons -->\n<link href=\"https://cdn.boxicons.com/{{VERSION}}/fonts/brands/boxicons-brands.min.css\" rel=\"stylesheet\">\n```\nAll font files are hosted on a fast and reliable CDN for easy global delivery.\n\n### For Pro Users\n\nIf you are a Boxicons Pro user, you can generate a custom CDN link from the **Usage** page. There, you can select exactly which **pack, style, and weight** you want to include in your project.\n\n<Image src=\"/usage.png\" alt=\"Usage page screenshot\" width={928} height={677} unoptimized />\n\nThe **Usage** link can be found in the icon mini-viewer and in the avatar dropdown menu.\n\n## Using Icons in HTML\n\nTo render an icon, add an `i` tag with the iconâ€™s class name.\n\n- `bx-` prefix is used for all icons\n\nExample:\n\n```html\n<i class=\"bx bx-volleyball\"></i>\n<i class=\"bxf bx-volleyball\"></i>\n<i class=\"bxl bx-twitter\"></i>\n```\n<div className=\"icon-display\">\n<i className=\"bxdocs bx-volleyball\"></i>\n<i className=\"bxdocs bxf-volleyball\"></i>\n<i className=\"bxdocs bx-twitter\"></i>\n</div>\n\n### Starter Template\nHereâ€™s a minimal HTML template to get you started:\n\n```html filename=\"starter.html\" copy\n<!doctype html>\n<html lang='en'>\n<head>\n<meta charset='utf-8'>\n<meta name='viewport' content='width=device-width, initial-scale=1, shrink-to-fit=no'>\n<!-- Boxicons CSS -->\n<link href='https://cdn.boxicons.com/{{VERSION}}/fonts/basic/boxicons.min.css' rel='stylesheet'>\n<link href='https://cdn.boxicons.com/{{VERSION}}/fonts/filled/boxicons-filled.min.css' rel='stylesheet'>\n<link href='https://cdn.boxicons.com/{{VERSION}}/fonts/brands/boxicons-brands.min.css' rel='stylesheet'>\n \n<title>Hello, Boxicons!</title>\n</head>\n<body>\n<h1>Hello, Boxicons!</h1>\n<i class='bx bx-hot'></i>\n<i class='bxf bx-fire'></i>\n<i class='bxl bx-twitter-x'></i>\n</body>\n</html>\n```\n\nYou can also access the SVG's from our CDN at:\n\n```html copy\nhttps://cdn.boxicons.com/{{VERSION}}/svg/<PACK_NAME>/<ICON_NAME_WITH_PREFIX_BX>.svg\n\n<img src=\"https://cdn.boxicons.com/{{VERSION}}/svg/basic/bx-8-ball.svg\" alt=\"8-ball\"/>\n<img src=\"https://cdn.boxicons.com/{{VERSION}}/svg/filled/bx-8-ball.svg\" alt=\"8-ball\"/>\n<img src=\"https://cdn.boxicons.com/{{VERSION}}/svg/brands/bx-facebook.svg\" alt=\"facebook\"/>\n```";
